import styled from "styled-components"
export const ServiceWrapper = styled.div`
  padding: 1rem 0;
  margin: 1rem 0;
  .header-page {
    font-size: 1.3rem;
    padding: 1rem;
    .link-to {
      color: #cacaca;
    }
  }

`
export const ServiceItems = styled.li`
  .name-service {
    font-weight: 550;
    padding: 1rem 0;
  }
`
